import style from "./SettingMenu.module.css";

const SETTING_MENU_TEXT = ["account", "appearance", "others"];

function SettingMenu(props) {
  function settingListClick(e) {
    props.setSettingContent(e.target.dataset.id);
  }

  const menu = SETTING_MENU_TEXT.map((element, index) => (
    <li onClick={settingListClick} data-id={index} className={style.list}>
      {element}
    </li>
  ));

  return (
    <div className={style.menu}>
      <ul className={style.unorder}>
        <li onClick={settingListClick} data-id="0" className={style.list}>
          account
        </li>
        <li onClick={settingListClick} data-id="1" className={style.list}>
          appearance
        </li>
        <li onClick={settingListClick} data-id="2" className={style.list}>
          others
        </li>
      </ul>
    </div>
  );
}

export default SettingMenu;
